INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2020/04/30 12:00:00", "あたしだって\nやるときはやるよ！", 0.0, 1, 102601, 0.0, 0.0, 1, 24001, 10040, "リン", "2030/12/17 14:59:59", 24, 0);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2020/04/30 12:00:00", "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, 1, 102601, 0.0, 0.0, 1, 24002, 10040, "リン", "2030/12/17 14:59:59", 24, 1);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2020/04/30 12:00:00", "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, 1, 102601, 0.0, 0.0, 1, 24003, 10040, "リン", "2030/12/17 14:59:59", 24, 2);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2020/04/30 12:00:00", "やったね！\nこれでようやく\nサボれるよ…", 0.0, 2, 102601, 0.0, 0.0, 2, 24004, 10040, "リン", "2030/12/17 14:59:59", 24, 3);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2020/04/30 12:00:00", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, 1, 102601, 0.0, 0.0, 1, 24005, 10040, "リン", "2030/12/17 14:59:59", 24, 4);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2020/04/30 12:00:00", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, 2, 102601, 0.0, 0.0, 2, 24006, 10040, "リン", "2030/12/17 14:59:59", 24, 5);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2020/04/30 12:00:00", "あたしも意外と\nやるもんでしょ？", 0.0, 2, 102601, 0.0, 0.0, 2, 24007, 10040, "リン", "2030/12/17 14:59:59", 24, 6);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2020/04/30 12:00:00", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, 4, 102601, 0.0, 0.0, 4, 24008, 10040, "リン", "2030/12/17 14:59:59", 24, 7);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2020/04/30 12:00:00", "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, 4, 102601, 0.0, 0.0, 4, 24009, 10040, "リン", "2030/12/17 14:59:59", 24, 8);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2020/04/30 12:00:00", "まじめに\nやったんだけどな…\n悔しいな～", 0.0, 4, 102601, 0.0, 0.0, 4, 24010, 10040, "リン", "2030/12/17 14:59:59", 24, 9);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2020/04/30 12:00:00", "やられた…\nねずみって意外と\nてごわいね", 0.0, 4, 102601, 0.0, 0.0, 4, 24011, 10040, "リン", "2030/12/17 14:59:59", 24, 10);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2020/04/30 12:00:00", "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, 4, 102601, 0.0, 0.0, 4, 24012, 10040, "リン", "2030/12/17 14:59:59", 24, 11);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES ("2020/04/30 12:00:00", "疲れた…\nけど、次こそは\n守り抜くよ…", 1.81, 1, 102601, 0.0, 0.0, 4, 24013, 10040, "リン", "2030/12/17 14:59:59", 24, 12);
